/*!40101 SET NAMES utf8 */;
/*!40014 SET FOREIGN_KEY_CHECKS=0 */;
/*!40101 SET SQL_MODE='NO_AUTO_VALUE_ON_ZERO' */;
/*!40111 SET SQL_NOTES=0 */;
DROP TABLE IF EXISTS cart;
CREATE TABLE `cart` (
  `email` varchar(50) DEFAULT NULL,
  `product_id` varchar(50) DEFAULT NULL,
  `curr_quantity` int(11) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

DROP TABLE IF EXISTS deleted_product;
CREATE TABLE `deleted_product` (
  `product_id` varchar(50) DEFAULT NULL,
  `productname` varchar(50) DEFAULT NULL,
  `price` varchar(20) DEFAULT NULL,
  `quantity` int(11) DEFAULT NULL,
  `details` varchar(100) DEFAULT NULL,
  `image` varchar(50) DEFAULT NULL,
  `s_email` varchar(50) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

DROP TABLE IF EXISTS dispatchers;
CREATE TABLE `dispatchers` (
  `email` varchar(50) DEFAULT NULL,
  `pass` varchar(50) DEFAULT NULL,
  `name` varchar(50) DEFAULT NULL,
  `state_name` varchar(50) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

DROP TABLE IF EXISTS orders;
CREATE TABLE `orders` (
  `email` varchar(50) DEFAULT NULL,
  `product_id` varchar(50) DEFAULT NULL,
  `Quantity` varchar(50) DEFAULT NULL,
  `order_date` varchar(100) DEFAULT NULL,
  `s_email` varchar(50) DEFAULT NULL,
  `state` varchar(50) DEFAULT NULL,
  `seller_d` varchar(100) DEFAULT NULL,
  `state_d` varchar(100) DEFAULT NULL,
  `city_d` varchar(100) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

DROP TABLE IF EXISTS products;
CREATE TABLE `products` (
  `productname` varchar(50) DEFAULT NULL,
  `price` varchar(20) DEFAULT NULL,
  `quantity` int(11) DEFAULT NULL,
  `product_id` varchar(50) DEFAULT NULL,
  `details` varchar(100) DEFAULT NULL,
  `image` varchar(25) DEFAULT NULL,
  `s_email` varchar(50) DEFAULT NULL,
  `flag` char(1) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

DROP TABLE IF EXISTS sellers;
CREATE TABLE `sellers` (
  `s_name` varchar(50) DEFAULT NULL,
  `s_email` varchar(50) DEFAULT NULL,
  `s_id` varchar(50) DEFAULT NULL,
  `s_aadhar` varchar(12) DEFAULT NULL,
  `is_verified` varchar(50) DEFAULT NULL,
  `s_password` varchar(50) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `name` varchar(50) DEFAULT NULL,
  `email` varchar(100) DEFAULT NULL,
  `password` varchar(16) DEFAULT NULL,
  `isvalid` tinyint(1) DEFAULT NULL,
  `mailToken` varchar(20) DEFAULT NULL,
  `role` varchar(20) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

DROP TABLE IF EXISTS user_info;
CREATE TABLE `user_info` (
  `email` varchar(50) DEFAULT NULL,
  `name` varchar(50) DEFAULT NULL,
  `pincode` varchar(6) DEFAULT NULL,
  `phone` varchar(10) DEFAULT NULL,
  `state_name` varchar(50) DEFAULT NULL,
  `city` varchar(50) DEFAULT NULL,
  `street_add` varchar(100) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

